package jerryofouc.github.io;

import java.util.HashMap;
import java.util.Map;
import java.util.TreeMap;

/**
 * Created by xiaojiez on 3/11/17.
 */
public class ReconstructOriginalDigitsfromEnglish {
    public static String originalDigits(String s) {
        String[][] digits =
                new String[][]{{"z","zero"},{"w","two"},{"g","eight"},{"x","six"},{"t","three"},
                        {"u","four"},{"o","one"},{"f","five"},{"s","seven"},{"e","nine"}};

        Map<String,Integer> stringIntegerMap = new HashMap<>();
        stringIntegerMap.put("zero",0);
        stringIntegerMap.put("one",1);
        stringIntegerMap.put("two",2);
        stringIntegerMap.put("three",3);
        stringIntegerMap.put("four",4);
        stringIntegerMap.put("five",5);
        stringIntegerMap.put("six",6);
        stringIntegerMap.put("seven",7);
        stringIntegerMap.put("eight",8);
        stringIntegerMap.put("nine",9);

        Map<Integer,Integer> resultMap = new TreeMap<>();
        Map<Character,Integer> charMap = new HashMap<>();
        for(int i=0;i<s.length();i++){
            Integer c = charMap.get(s.charAt(i));
            if(c == null){
                c = 0;
            }
            charMap.put(s.charAt(i),++c);
        }

        for(int i=0;i<digits.length;i++){
            char a = digits[i][0].charAt(0);
            Integer c = charMap.get(a);
            if(c != null && c != 0){
                 for(int k=0;k<digits[i][1].length();k++){
                     charMap.put(digits[i][1].charAt(k),charMap.get(digits[i][1].charAt(k))-c);
                 }
                 Integer d = resultMap.get(stringIntegerMap.get(digits[i][1]));
                 if(d == null){
                     d = 0;
                 }
                 resultMap.put(stringIntegerMap.get(digits[i][1]),d+c);
            }
        }

        StringBuilder result = new StringBuilder();
        for(Map.Entry<Integer,Integer> entry : resultMap.entrySet()){
            for(int i=0;i<entry.getValue();i++){
                result = result.append(entry.getKey()) ;
            }
        }
        return result.toString();
    }

    public static void main(String[] args) {
        long t1 = System.currentTimeMillis();
        System.out.println(originalDigits(""));
        long t2 = System.currentTimeMillis();

        System.out.println(t2-t1);
    }
}
